import React from 'react';

const Services = () => (
  <section className="p-3">
    <h2>Our Services</h2>
    <ul>
      <li>Web Development</li>
      <li>App Development</li>
      <li>Consulting</li>
    </ul>
  </section>
);

export default Services;
